    value: 'This report has been amended in response to the Commissions'' preliminary
      review of the 12 Day Pre-General Report.  The contribution from John Rich Jr.
      that exceeded contribution limits for state parties has been refunded and noted
      on text memo under his name.  Copy of the check stub has been sent to FEC via
      USPS.  Santorum 2006 reimbursement (line15) for payment of services and/or goods
      has been clarified.  Services have been invoiced at fair market value.  Disbursements
      to Brabender Cox and Campbell and Campbell meet the definition of exempt activity.  We
      have clarified that distribution of materials was by volunteers. No public advertising
      was used. The Absentee Ballot mailer is also an exempt activity under FEA.  Please
      see text memo under Majority Strategies. A copy of the absentee ballot has been
      mailed to the FEC.  Business Reply Postage has also been clarified and is correctly
      disclosed on line 21B.  Fundraising Commissions and Fundraising Consultant both
      pertain to fundraisers who do generic party fundraising for the state party.  Theses
      expenditures were not made on behalf of a federal candidate.  '
